    background-color: #f605;
    width:100%;
    height:60px;
    display: flex;
    justify-content: center;
    align-items: center;
    padding:0 40px;

    .nav{
      width:100%;
      background-color: #00f5;
      display: flex;
      margin:0 auto;

      .navInner{
        width:100%;

        .logoImg{
          width:80px;
          height:auto;
        }
      }
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <nav className='nav'>
